function Ruokalista(props) {

    return (
        <div>
            {
                props.ruoat.map(ruoka => {
                    return (
                        <p key={ruoka.id}>
                            Ruoan nimi: {ruoka.nimi}<br />
                            Päivämäärä: {ruoka.pvm}<br />
                            Kellonaika: {ruoka.kellonaika}<br />
                            Lisätietoja: {ruoka.lisatiedot}<br />
                            <input type='button' value='Muokkaa' />
                        </p>
                        
                    ) // return
                }) // map
            }
        </div>
    )
}
